import React from 'react';
import education from'../data/education.json'



const Education = () => {
    return (
        <div>
            {
                education.map(school=>{
                    return(
                        <div>
                            <h1>{school.where}</h1>
                        </div>
                    )
                })
            }
        </div>
    );
};

export default Education;
